ОСНОВАНИЕ ДЛЯ ЗАКЛЮЧЕНИЯ ДОГОВОРА: 
ЗАКОН РЕСПУБЛИКИ КАЗАХСТАН &quot;О государственных закупках&quot; пп.3 п. 3 ст. 39 
&quot;приобретения товаров, услуг, являющихся объектами интеллектуальной собственности, у лица, обладающего исключительными правами в отношении приобретаемых товаров, услуг;&quot;
